import React from "react";
import axios from "axios";
import { useState, useEffect } from "react";


function Signup() {
    const [accountUp, setAccountUp] = useState();
    const [passwordUp, setPasswordUp] = useState();
    return (
        <div>
            <center>
            <div>
                Account <input type={"text"} onChange={e => setAccountUp(e.target.value)} ></input>

            </div>
            <div>
                Password<input type={"password"} onChange={e => setPasswordUp(e.target.value)}></input>
            </div>
            <button onClick={() => {
                axios.post('http://localhost:8080/login/signup', {
                    account: accountUp,
                    password: passwordUp
                }).then(function (response) {
                    // handle success
                    console.log(response);

                })
                    .catch(function (error) {
                        // handle error
                        console.log(error);
                    })
            }}>Sign Up</button>
            </center>
        </div>
    )
}
export default Signup
